    closeAllOthers(); 
 var code = '';
    code += 'CODE: \n SET !EXTRACT_TEST_POPUP NO \n SET !ERRORIGNORE YES \n SET !ERRORCONTINUE YES \n SET !TIMEOUT_STEP 0 \n';
    code += 'TAB T=1'  + n;
code += 'URL GOTO=http://dailyfreebits.com/' + n;
    iimPlay(code, 60);
iimPlayCode('SET !TIMEOUT 1\nTAG POS=1 TYPE=INPUT:TEXT FORM=ACTION:/faucet ATTR=NAME:address CONTENT=' + btchub );
	iimPlayCode('TAG POS=1 TYPE=BUTTON FORM=ACTION:/faucet ATTR=TXT:GO'); 

  weit(2)    
